text:['"[{\"start\":0,\"editorState\":{\"blocks\":[{\"key\":\"dfmt1\",\"text\":\"What is the history of breathwork and how does breathwork reduce stress? In this slide you will read about the history and dive more into the physiology of how stress effects the body. You will learn about how your pace of breathing can influence your body\'s stress response. There will be a quiz question on each of these.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":323,\"style\":\"textShadowX:0px\"},{\"offset\":0,\"length\":323,\"style\":\"fontStretch:normal\"},{\"offset\":0,\"length\":323,\"style\":\"fontType:regular\"},{\"offset\":0,\"length\":323,\"style\":\"color:#ffffff\"},{\"offset\":0,\"length\":323,\"style\":\"defaultBackgroundColor:#E8D01B\"},{\"offset\":0,\"length\":323,\"style\":\"textShadowY:4px\"},{\"offset\":0,\"length\":323,\"style\":\"textShadowColor:#F1EEE61F\"},{\"offset\":0,\"length\":323,\"style\":\"lineHeight:135%\"},{\"offset\":0,\"length\":323,\"style\":\"letterSpacing:0%\"},{\"offset\":0,\"length\":323,\"style\":\"textHighlightEnable:false\"},{\"offset\":0,\"length\":323,\"style\":\"textTransform:none\"},{\"offset\":0,\"length\":323,\"style\":\"textShadowOpacity:none\"},{\"offset\":0,\"length\":323,\"style\":\"overridden:true\"},{\"offset\":0,\"length\":323,\"style\":\"textDecoration:none\"},{\"offset\":0,\"length\":323,\"style\":\"fontFamily:Georgia\"},{\"offset\":0,\"length\":323,\"style\":\"borderBottomStyle:none\"},{\"offset\":0,\"length\":323,\"style\":\"textShadowEnable:false\"},{\"offset\":0,\"length\":323,\"style\":\"hlnk:\"},{\"offset\":0,\"length\":323,\"style\":\"fontWeight:normal\"},{\"offset\":0,\"length\":323,\"style\":\"textShadowBlur:8px\"},{\"offset\":0,\"length\":323,\"style\":\"desktop-fontSize:24\"},{\"offset\":0,\"length\":323,\"style\":\"backgroundColor:unset\"},{\"offset\":0,\"length\":323,\"style\":\"WebkitTextStrokeWidth:1px\"},{\"offset\":0,\"length\":323,\"style\":\"hlnkt:wp\"},{\"offset\":0,\"length\":323,\"style\":\"fontStyle:normal\"},{\"offset\":0,\"length\":323,\"style\":\"mobile-fontSize:24\"},{\"offset\":0,\"length\":323,\"style\":\"defaultTextStrokeWidth:1px\"},{\"offset\":0,\"length\":323,\"style\":\"WebkitTextStrokeColor:#F1EEE6\"},{\"offset\":0,\"length\":323,\"style\":\"textOutlineEnable:false\"},{\"offset\":0,\"length\":323,\"style\":\"opacity:1\"},{\"offset\":0,\"length\":323,\"style\":\"defaultTextStrokeColor:#F1EEE6\"},{\"offset\":0,\"length\":323,\"style\":\"hlnke:true\"},{\"offset\":0,\"length\":323,\"style\":\"defaultTextShadow:none\"},{\"offset\":0,\"length\":323,\"style\":\"tablet-fontSize:24\"},{\"offset\":0,\"length\":323,\"style\":\"textShadow:none\"}],\"entityRanges\":[],\"data\":{\"listDepth\":\"0\",\"listColor\":\"#666666\",\"verticalAlignMarginBottom\":\"0px\",\"listIndent\":\"100%\",\"overridden\":\"true\",\"marginLeft\":\"0px\",\"verticalAlignMarginTop\":\"auto\",\"listType\":\"S_Bullets08\",\"textAlign\":\"center\",\"marginBottom\":\"0%\",\"presetId\":\"text-closedcaptions\",\"listSize\":\"100%\"}}],\"entityMap\":{}},\"CCPosition\":\"BOTTOM\",\"text\":\"What is the history of breathwork and how does breathwork reduce stress? In this slide you will read about the history and dive more into the physiology of how stress effects the body. You will learn about how your pace of breathing can influence your body\'s stress response. There will be a quiz question on each of these.\",\"duration\":19,\"end\":19,\"id\":\"caption__3725__5\",\"dirtyReasons\":[],\"speechAgentV1\":{\"name\":\"Danielle - Canadian Narrator\",\"id\":\"FVQMzxJGPUBtfz1Azdoy\",\"source\":\"ElevenLabs\"}}]"']
